  flex-direction: column;
  width: 100%;
  height: auto;

  background-color: blueviolet;
`;

export default function ProductDetail({ productId }: IProductProps) {
  return (
    <Container>
      <Header></Header>
      <Info></Info>
      <Footer></Footer>
    </Container>
  );
}
